perspectives.style:
@controls {
  top {
    cluster {
      as: buttons;
      multiple: true;
    }

    cluster {
      by: "Element type", "Owner", "Policy reach", "Strategy", "Tags", "Year", "Policy", "Legislation";
      as: buttons;
      multiple: true;
      default: "";
    }
  }

  bottom-right {
    filter {
      target: element;
      by: "Element type";
      as: dropdown;
      multiple: true;
      default: show-all;
    }

    filter {
      target: element;
      by: "Owner";
      as: dropdown;
      multiple: true;
      default: show-all;
    }

    filter {
      target: element;
      by: "Policy reach";
      as: dropdown;
      multiple: true;
      default: show-all;
    }

    filter {
      target: element;
      by: "Strategy";
      as: dropdown;
      multiple: true;
      default: show-all;
    }

    filter {
      target: element;
      by: "Tags";
      as: dropdown;
      multiple: true;
      default: show-all;
    }

    filter {
      target: element;
      by: "Year";
      as: dropdown;
      multiple: true;
      default: show-all;
    }

    filter {
      target: element;
      by: "Policy";
      as: dropdown;
      multiple: true;
      default: show-all;
    }

    filter {
      target: element;
      by: "Legislation";
      as: dropdown;
      multiple: true;
      default: show-all;
    }
  }
}

@settings {
  template: custom;
  element-color: categorize("Element Type", neon2);
}
